+          <Link href={"Skintypes"} className={style.links}>
+            <Image
+              className={style.img}
+              src={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcShrCQgfD9QCHTWN1ive5HhFoXB0qncPEJ26g&s"}
